    <title>Out On A Limb</title>
    <style>
        button {
            position: absolute;
            top: 25%;
            left: 50%;
            font-size: 20px;
            font-family: "Verdana", sans-serif;
        }

        h1 {
            color: white;
            font-family: "Verdana", sans-serif;
            font-size: 28px;
        }

        body {
            background: linear-gradient(-45deg, #ee7752, #e73c7e, #23a6d5, #23d5ab);
            background-size: 400% 400%;
            animation: gradient 15s ease infinite;
        }

        @keyframes gradient {
            0% {
                background-position: 0% 50%;
            }
            50% {
                background-position: 100% 50%;
            }
            100% {
                background-position: 0% 50%;
            }
        }

        .container {
            width: 700px;
            position: absolute;
        }

        .falling {
            animation: falling-animation 5s linear forwards;
        }

        @keyframes falling-animation {
            from {
                transform: translateY(-3rem);
            }

            to {
                transform : translateY(3rem);
            }
        }

        .fade-in {
            position: absolute;
            animation: fadeIn ease 0.5s;
            -webkit-animation: fadeIn ease 0.5s;
            -moz-animation: fadeIn ease 0.5s;
            -o-animation: fadeIn ease 0.5s;
            -ms-animation: fadeIn ease 0.5s;
        }
        @keyframes fadeIn {
            0% {
                opacity:0;
            }
            100% {
                opacity:1;
            }
        }

        @-moz-keyframes fadeIn {
            0% {
                opacity:0;
            }
            100% {
                opacity:1;
            }
        }

        @-webkit-keyframes fadeIn {
            0% {
                opacity:0;
            }
            100% {
                opacity:1;
            }
        }

        @-o-keyframes fadeIn {
            0% {
                opacity:0;
            }
            100% {
                opacity:1;
            }
        }

        @-ms-keyframes fadeIn {
            0% {
                opacity: 0;
            }
            100% {
                opacity: 1;
            }
        }

        .fade-out {
            position: absolute;
            animation: fadeOut ease 0.5s;
            -webkit-animation: fadeOut ease 0.5s;
            -moz-animation: fadeOut ease 0.5s;
            -o-animation: fadeOut ease 0.5s;
            -ms-animation: fadeOut ease 0.5s;
        }
        @keyframes fadeOut {
            0% {
                opacity:1;
            }
            100% {
                opacity:0;
            }
        }

        @-moz-keyframes fadeOut {
            0% {
                opacity:1;
            }
            100% {
                opacity:0;
            }
        }

        @-webkit-keyframes fadeOut {
            0% {
                opacity:1;
            }
            100% {
                opacity:0;
            }
        }

        @-o-keyframes fadeOut {
            0% {
                opacity:1;
            }
            100% {
                opacity:0;
            }
        }

        @-ms-keyframes fadeOut {
            0% {
                opacity: 1;
            }
            100% {
                opacity: 0;
            }
        }
    </style>

    const music = new Audio("data:audio/mp3;base64," + base64Music);
    const renderArea = document.getElementById("render_area");
    const fadeOutTime = 500;

    function randomLocation(min, max) {
    	return  (Math.floor(Math.random() * (max - min + 1)) + min) + "%"
    }

    function renderText(text, time = 3000, top, left) {
		top = top ?? randomLocation(10, 90);
		left = left ?? randomLocation(10, 40);
		const newContainer = document.createElement("div");
        const newElement = document.createElement("h1");
        newContainer.appendChild(newElement);
        newContainer.className = "container falling";
		newContainer.style = `left: ${left}; top: ${top}`;
        newElement.className = "fade-in";
        newElement.innerText = text;
		renderArea.appendChild(newContainer)

		// fade-out
        setTimeout(() => {
        	newElement.className = "fade-out";
        }, time - fadeOutTime + 200);

        // delete
        setTimeout(() => {
        	renderArea.removeChild(newContainer);
        }, time);
    }

    function playSong() {
		const button = document.getElementById("toggle");
		if (button) {
			renderArea.removeChild(button);
        }
        const timeStamps = Object.keys(script).sort((a,b) => a - b).map(Number);

		// to stop 2 at the same time due to asynchronous music playing
		let running = false;

        function determineShow() {
            if (!running && timeStamps[0] <= music.currentTime) {
            	running = true;
            	renderText(script[timeStamps[0]]);
            	timeStamps.shift();
            	running = false;
            	determineShow();
            }
        }

        function onEnd() {
        	renderText("onehtmlpagechallenge.com", 5000, "50%", "50%");
        	setTimeout(playSong, 5000);
        }

        music.onended = onEnd;
		music.ontimeupdate = determineShow;
        music.play();
    }

</script>
